// Styles
import { Flex } from '@chakra-ui/core';

// Components
import NavSkeleton from './NavSkeleton';

const Nav = () => {
  return (
    <Flex justifyContent="space-evenly" paddingBottom="2rem">
      <NavSkeleton endpoint={'/history'} title="History" />
      <NavSkeleton endpoint={'/'} title="Home" />
    </Flex>
  );
};

export default Nav;
